import Header from './Header.jsx';
import MainPageNavigation from './MainPageNavigation.jsx';
import InstaList from './InstaList.jsx';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import React from 'react';
import Typed from "typed.js";

import 'bulma/css/bulma.min.css';
import './App.css';
import logo from './logo.svg';

class App extends React.Component {
  render() { 
    return 
    <Router>
      <div className="App">
        <section class="section">
          <div class="container">
            <Header type="insta-list"/>
            {/* A <Switch> looks through its children <Route>s and
                renders the first one that matches the current URL. */}
            <Switch>
              <Route exact path="/">
                <MainPageNavigation/>
              </Route>
              <Route exact path="/instalist/new_list">
                <InstaList/>
              </Route>
            </Switch>
          </div>
        </section>
      </div>
    </Router>
  };
}

function InstaListRouter() {
  return (
    <Switch>
      <Route path={`${match.path}/new_list`}>
        <InstaList/>
      </Route>
      <Route path={`${match.path}/:listId`}>
        Chodes
      </Route>
    </Switch>
    );
}

export default App;
